import React from "react";
import "../style/Navigation.css";

import account from "./img/account.png";
import cart from "./img/cart.png";

const Navigation = () => {
  return (
    <>
      <div className='logo-account-link-container'>
        <div className='logo'>plantarrium</div>
        <div className='account'>
          <img className='nav-icon' src={account} alt='avatar-account-icon' />
          <img className='nav-icon' src={cart} alt='shopping-cart-icon' />
        </div>
        <div className='plant-categories-container'>
          <div className='plant-categories-label'>Shop All Plants</div>
          <div className='plant-categories-label'>Large Plants</div>
          <div className='plant-categories-label'>Medium Plants</div>
          <div className='plant-categories-label'>Small Plants</div>
        </div>
      </div>
    </>
  );
};

export default Navigation;
